import Home from './pages/home/home'
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/program" element={<ProgramPage />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
